  {product_id: 7, event_id: nil, name_text_old: nil, internal_name: "the_canal_shoppes", description_text_old: nil, status: "deleted", starts_at: "2018-05-27 16:00:00", ends_at: nil, picture_file_name: "Laura-Kimpton-LOVE-The-Venetian-Las-Vegas-1.jpg", picture_content_type: "image/jpeg", picture_file_size: 91785, picture_updated_at: "2018-07-17 19:29:39", picture_meta: "BAh7CDoNb3JpZ2luYWx7CDoKd2lkdGhpAokCOgtoZWlnaHRpAnQBOglzaXpl\naQOJZgE6DG9wdGltYWx7CDsGaQLoAzsHaQI9AjsIaQMvlgE6DnRodW1ibmFp\nbHsIOwZpaTsHaWk7CGkCQRY=\n", name: {"un"=>"The Canal Shoppes"}, description: {"un"=>"Shop, dine and experience Grand Canal Shoppes, an extraordinary Venetian-inspired shopping mall and dining destination on the Las Vegas Strip. With six prestigious art galleries and unique offerings from five celebrity chefs, the Shoppes is home to over 160 signature stores and premier luxury brands as well as more than a dozen world-class restaurants."}, reward_id: nil},
