  {product_id: 7, event_id: nil, name_text_old: nil, internal_name: "art_critic", description_text_old: nil, status: "deleted", starts_at: "2018-07-05 00:00:00", ends_at: nil, picture_file_name: "AdobeStock_181203516.jpeg", picture_content_type: "image/jpeg", picture_file_size: 3097767, picture_updated_at: "2018-07-17 19:29:55", picture_meta: "BAh7CDoNb3JpZ2luYWx7CDoKd2lkdGhpAiMROgtoZWlnaHRpArELOglzaXpl\naQOnRC86DG9wdGltYWx7CDsGaQLoAzsHaQKqAjsIaQL9yDoOdGh1bWJuYWls\newg7BmlpOwdpaTsIaQJwTA==\n", name: {"un"=>"Art Critic"}, description: {"un"=>"Downtown Las Vegas has been taken over by local artists since the inception of the Life is Beautiful Music & Art Festival in 2013. Every year since, local and globally known artists have been commissioned to paint murals and build sculptures among the streets within Fremont East District.\r\n\r\nJoin us on the Art Critic quest throughout DTLV to explore the unique murals and differing artist perspectives. This quest can be done on foot as it takes you around Fremont Street (about 1 mile). "}, reward_id: nil},
  {product_id: 7, event_id: nil, name_text_old: nil, internal_name: "modern_day_hipster", description_text_old: nil, status: "deleted", starts_at: "2018-06-29 10:46:00", ends_at: nil, picture_file_name: "AdobeStock_181203516.jpeg", picture_content_type: "image/jpeg", picture_file_size: 3097767, picture_updated_at: "2018-07-17 19:29:47", picture_meta: "BAh7CDoNb3JpZ2luYWx7CDoKd2lkdGhpAiMROgtoZWlnaHRpArELOglzaXpl\naQOnRC86DG9wdGltYWx7CDsGaQLoAzsHaQKqAjsIaQL9yDoOdGh1bWJuYWls\newg7BmlpOwdpaTsIaQJwTA==\n", name: {"un"=>"Art Critic"}, description: {"un"=>"Downtown Las Vegas has been taken over by local artists since the inception of the Life is Beautiful Music & Art Festival in 2013. Every year, local and globally known artists are commissioned to paint murals and building sculptures among the buildings in Fremont East District and around Downtown Las Vegas. \r\n\r\nJoin us on this quest throughout DTLV to explore the unique art and different perspectives of the artists. This quest can be done on foot as it takes it from the crossroads of 11th St & Fremont St up to Las Vegas Blvd & Fremont St (about 1 mile).\r\n"}, reward_id: nil},
  {product_id: 7, event_id: nil, name_text_old: nil, internal_name: "the_love_machine", description_text_old: nil, status: "deleted", starts_at: "2018-06-25 03:00:00", ends_at: nil, picture_file_name: "AdobeStock_88856691.jpeg", picture_content_type: "image/jpeg", picture_file_size: 2027957, picture_updated_at: "2018-07-17 19:29:40", picture_meta: "BAh7CDoNb3JpZ2luYWx7CDoKd2lkdGhpAqAPOgtoZWlnaHRpAmAKOglzaXpl\naQO18R46DG9wdGltYWx7CDsGaQLoAzsHaQKYAjsIaQJ93ToOdGh1bWJuYWls\newg7BmlpOwdpaTsIaQJleA==\n", name: {"un"=>"Hopeless Romantic"}, description: {"un"=>"Las Vegas is known for its quickie weddings due to the ease of getting a marriage license and the dozens of chapels up and down Las Vegas Blvd. Naturally, a few celebrities have had a few too many and taken full advantage of it. \r\n\r\nThe Hopeless Romantic is someone in love with the idea of being in love. Basically, life equals love. If you find yourself tearing up just at the idea of a wedding, this quest is for you. \r\n\r\nThis quest takes you down Las Vegas Blvd. about 8 miles, so walking is not recommended in the summer. \r\n"}, reward_id: nil},
