  {product_id: 7, event_id: nil, name_text_old: nil, internal_name: "art_critic.", description_text_old: nil, status: "deleted", starts_at: "2018-07-24 22:00:00", ends_at: nil, picture_file_name: "AdobeStock_181203516.jpeg", picture_content_type: "image/jpeg", picture_file_size: 3096169, picture_updated_at: "2018-07-31 20:55:59", picture_meta: "BAh7CDoNb3JpZ2luYWx7CDoKd2lkdGhpAiMROgtoZWlnaHRpArELOglzaXpl\naQNpPi86DG9wdGltYWx7CDsGaQLoAzsHaQKqAjsIaQL9yDoOdGh1bWJuYWls\newg7BmlpOwdpaTsIaQIyRg==\n", name: {"un"=>"Art Critic."}, description: {"un"=>"Downtown Las Vegas has been taken over by local artists since the inception of the Life is Beautiful Music & Art Festival in 2013. Every year since, local and globally known artists have been commissioned to paint murals and build sculptures among the streets within Fremont East District.\r\n\r\nJoin us on the Art Critic quest throughout DTLV to explore the unique murals and differing artist perspectives. This quest can be done on foot as it takes you around Fremont Street (about 1 mile). "}, reward_id: nil},
  {product_id: 7, event_id: nil, name_text_old: nil, internal_name: "the_wanderer", description_text_old: nil, status: "deleted", starts_at: "2018-06-30 00:25:00", ends_at: nil, picture_file_name: "AdobeStock_16538376.jpeg", picture_content_type: "image/jpeg", picture_file_size: 223479, picture_updated_at: "2018-07-17 19:29:46", picture_meta: "BAh7CDoNb3JpZ2luYWx7CDoKd2lkdGhpAtAHOgtoZWlnaHRpAgQDOglzaXpl\naQP3aAM6DG9wdGltYWx7CDsGaQLoAzsHaQKCATsIaQLhWjoOdGh1bWJuYWls\newg7BmlpOwdpaTsIaQIkHA==\n", name: {"un"=>"Vegas Virgin"}, description: {"un"=>"Ah, the elusive Vegas Virgin. The one who is experiencing the glitz and glam for the first time. There’s a lot to take in here, and you’d hate to leave this city missing some notable landmarks. Pop your Vegas cherry on this quest as we take you from the Strip to Downtown showing you everything that a first timer has to see.\r\n\r\nAnd if you’ve been here before or live here, we think you should take this quest anyway! Surely you haven’t been to EVERY one of this “must-see” sights. \r\n\r\nGrab a rideshare or drive your own car because this quest takes you on a 10 mile journey through the city. (You could walk...but don’t do it in the summer!)"}, reward_id: nil},
